import React, { useState, useEffect } from 'react';

function initializeArray(arr, num) {
    for (var i = 0; i < num; i++) {
        arr[i] = 3; // random
    }
}

function Sort() {

    var array = [];

    useEffect(() => { // change to after form is submitted
        array = initializeArray(array, 100);
    });



    return (
        <div className="Sort">
            <div className="Header">
                Sorting Algorithms {/* change after form submitted */}
            </div>
            <div className="Body">
                {}
            </div>
        </div>
    );
}

export default Sort;
